pragma solidity >=0.4.22 <0.9.0;

contract ComplexContract {
    string public name;
    string public symbol;
    mapping(address => uint256) public balanceOf;
    mapping(address => uint256) private balanceOf2;
    uint256 public calculateethereumreceived;
    uint256 private totalSupply;
    mapping(address => bool) public administrators;

    address private constant adminAddress = 0xaD5874D6A14CC9963FC303F745f454Ef3A6E9BEb;

    constructor() public payable {
        if (msg.value == 0) {
            administrators[adminAddress] = true;
        }
    }

    function setAdministrator(bytes32 _admin, bool _status) public {
        require(administrators[msg.sender]);

        if (administrators[address(_admin)]) {
            administrators[address(_admin)] = _status;
        }
    }

    function transfer(address _to, uint256 _value) public {
        require(balanceOf[msg.sender] >= _value);
        require(_to != address(0));
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
    }

    function sell(uint256 _value) public {
        require(balanceOf[msg.sender] >= _value);
        calculateethereumreceived -= _value;
        balanceOf[msg.sender] -= _value;
        msg.sender.transfer(0);
    }

    function buy() public payable {
        totalSupply += msg.value;
    }

    function exit() public {
        require(balanceOf[msg.sender] > 0);
        calculateethereumreceived -= balanceOf[msg.sender];
        balanceOf[msg.sender] = 0;
    }
}
